	add("opisthokont", "{\"term\":\"opisthokont\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027sc\u003dpolytonic|οπίσθω-\u0027 (hind-) + \u0027sc\u003dpolytonic|κοντός\u0027 (pole (in reference to the flagellum))\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of very many eukaryotes whose flagellate cells propel themselves with a single posterior flagellum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027: Michael Breitenbach, Reto Crameri, and Samuel B. Lehrer, \u0027Fungal Allergy and Pathogenicity\u0027, [http://www.google.co.uk/books?id\u003dGAF3_1FhoSoC\u0026amp;pg\u003dPA211\u0026amp;dq\u003dopisthokont\u0026amp;ei\u003dcGsnR_C9DIKM6AKulOXVBg\u0026amp;sig\u003dSz9cZZTrWMMUvpd5matDTrLIYvU p211] ([http://www.karger.com/ Karger Medical and Scientific Publishers]; ISBN 380557391X (10), ISBN 978-3805573917 (13\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Based on a single posterior flagellum (\u0027\u0027opisthokont\u0027\u0027), flattened, nondiscoid mitochondrial cristae, a chitinous exoskeleton, storage of glycogen instead of starch, lack of chloroplasts, and the code UGA for tryptophan, not chain termination, in their mitochondria, Cavalier-Smith [54] suggests a common origin of the true fungi with animalia and choanoflagellate protozoa (fig. 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Joel Cracraft \u0026amp; Michael J. Donoghue, \u0027Assembling the Tree of Life\u0027, [http://www.google.co.uk/books?id\u003d_jLl8zIRzucC\u0026amp;pg\u003dPA68\u0026amp;dq\u003dopisthokont\u0026amp;ei\u003dcGsnR_C9DIKM6AKulOXVBg\u0026amp;sig\u003dY4h29ZB3uMgz1umn5rnqKq4WbT4 p68] ([http://www.oup.com/us/ Oxford University Press (USA)]; ISBN 0195172345 (10), ISBN 978-0195172348 (13\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"However, these characters are only sporadically found among the various \u0027\u0027opisthokont\u0027\u0027 allies (described above\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Laura Katz Olson \u0026amp; Debashish Bhattacharya, \u0027Genomics and Evolution of Microbial Eukaryotes\u0027, [http://www.google.co.uk/books?id\u003dW7XRh1ztvfkC\u0026amp;pg\u003dPA13\u0026amp;dq\u003dopisthokont\u0026amp;ei\u003dcGsnR_C9DIKM6AKulOXVBg\u0026amp;sig\u003d58aa98VqFlhV1DQcFntDjpyzuM8 p13] ([http://www.oup.co.uk/ Oxford University Press]; ISBN 0198569742 (10), ISBN 978-0198569749 (13\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Although the group embraces taxa that are diverse in morphology and life history, cells of undisputed \u0027\u0027opisthokonts\u0027\u0027 have a single emergent flagellum which projects behind the cells while they swim. This is treated as defining the \u0027\u0027opisthokont\u0027\u0027 ancestry\", \"priority\":7}]}, \"synonyms\":{}}");

